import React from "react";

class BurgerCart extends React.Component {
    constructor(props) {
        super(props)
    }
    render () {

        return (
            <>
                {this.props.ingredients.map((arr) => {
                    return <p>{arr}</p>
                })}
            </>
        )
    }
}

export default BurgerCart
